const MyRoutes = () => {
  return (
    <Routes>
      <Route path="/users" element={<UsersPage />} />
      <Route path="/profile" element={<Profile />} />
      <Route path="/posts" element={<PostsPage />} />
      <Route path="/dashboard" element={<Dashboard />} />
      <Route path="/auth" element={<div>Auth</div>} />
    </Routes>
  );
};

export default MyRoutes;
